import React from "react";
import './App.css';
import Header from "./components/Header";
import Form from "./components/Form";
import Download from "./components/Download";

function App() {
  return (
    <div className="App">
      <Header />
      <div className="main-container">
        <Form />
      </div>
      <div className="download">
        <Download />
      </div>

    </div>
  );
}

export default App;
